Fetch dataset for judgeval
Note: All data objects returned in this dataset are copies (everything is the same except the IDs) so that if users run evals, the original data is not affected.
    {
        "dataset_alias": dataset_alias,
        "project_name": project_name
    }

Fetch all datasets for a given project name.

Request:
    {
        "project_name": str,
    }
    ==>
    [
        {
            "examples": [...],
            "_id": "..."
        },
        ...
    ]

Delete a dataset by alias.

Request:
    {
        "dataset_alias": "dataset_name",
        "project_name": "project_name"
    }
